import React, { useEffect } from 'react';

const NewsPage = ({ news, fetchNews }) => {
  useEffect(() => {
    fetchNews();
  }, [fetchNews]);

  return (
    <div className="news-page">
      <h2>Latest News</h2>
      <ul>
        {news.map((item, index) => (
          <li key={index}>
            <a href={item.url} target="_blank" rel="noopener noreferrer">{item.title}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default NewsPage;
